import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';

// General Pages
import Home from './components/Home';
import AboutUs from './components/AboutUs';
import ContactUs from './components/ContactUs';

// Vendor Pages
import VendorHome from './components/Vendor/VendorHome';
import VendorRegister from './components/Vendor/VendorRegister';
import VendorLogin from './components/Vendor/VendorLogin';
import VendorDashboard from './components/Vendor/VendorDashboard';

// Vendi (User) Pages
import VendiLogin from './components/Vendi/VendiLogin';
import SignUp from './components/Vendi/VendiSignup';
import ProductListing from './components/Vendi/ProductDiscovery';
import Cart from './components/Vendi/Cart';
import VendiDashboard from './components/Vendi/Dashboard';
import ProfileSettings from './components/Vendi/ProfileSettings';
import DiscoverProducts from './components/Vendi/DiscoverProducts';
import AllProducts from './components/Vendi/AllProducts';
import SportsOutdoor from './components/Vendi/SportsOutdoor';
import ClothingCollection from './components/Vendi/ClothingCollection';
import Electronics from './components/Vendi/Electronics';
import HomeGarden from './components/Vendi/HomeGarden';
import Beauty from './components/Vendi/Beauty';
import Food from './components/Vendi/Food';
import Checkout from './components/Vendi/Checkout'; // Assuming you have a Checkout component
import ReturnRequest from './components/Vendi/ReturnRequest'; // Assuming you have a ReturnRequest component
import OrderConfirmation from './components/Vendi/OrderConfirmation'; // Assuming you have an OrderConfirmation component
import TrackingDetails from './components/Vendi/TrackingDetails'; // Assuming you have a TrackingDetails component
import OrderReview from './components/Vendi/OrderReview'; // Assuming you have an OrderReview component
import ProductDetails from './components/Vendi/ProductDetails'; // Assuming you have a ProductDetails component

// Support Pages
import EmailSupport from './components/EmailSupport';
import SubmitTicket from './components/SubmitTicket';
import TicketSuccess from './components/TicketSuccess';

function App() {
  return (
    <Router>
      <Routes>
        {/* General Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutUs />} />
        <Route path="/contact" element={<ContactUs />} />

        {/* Vendor Routes */}
        <Route path="/vendor" element={<VendorHome />} />
        <Route path="/vendor/register" element={<VendorRegister />} />
        <Route path="/vendor/login" element={<VendorLogin />} />
        <Route path="/vendor/dashboard" element={<VendorDashboard />} />

        {/* Vendi (User) Routes */}
        <Route path="/vendi/login" element={<VendiLogin />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/vendi/products" element={<ProductListing />} />
        <Route path="/vendi/cart" element={<Cart />} />
        <Route path="/vendi/dashboard" element={<VendiDashboard />} />
        <Route path="/vendi/profile-settings" element={<ProfileSettings />} />
        <Route path="/vendi/discover-products" element={<DiscoverProducts />} />
        <Route path="/vendi/all-products" element={<AllProducts />} />
        <Route path="/vendi/sports-outdoor" element={<SportsOutdoor />} />
        <Route path="/vendi/clothing-collection" element={<ClothingCollection />} />
        <Route path="/vendi/electronics" element={<Electronics />} />
        <Route path="/vendi/home-garden" element={<HomeGarden />} />
        <Route path="/vendi/beauty" element={<Beauty />} />
        <Route path="/vendi/food" element={<Food />} />
        <Route path="/vendi/checkout" element={<Checkout />} />
        <Route path="/vendi/return-request" element={<ReturnRequest />} />
        <Route path="/vendi/order-confirmation" element={<OrderConfirmation />} />
        <Route path="/vendi/tracking-details" element={<TrackingDetails />} />
        <Route path="/vendi/order-review" element={<OrderReview />} />
        <Route path="/vendi/product-details" element={<ProductDetails />} />

        {/* Support Routes */}
        <Route path="/email-support" element={<EmailSupport />} />
        <Route path="/submit-ticket" element={<SubmitTicket />} />
        <Route path="/ticket-success" element={<TicketSuccess />} />

        {/* Fallback */}
        <Route path="*" element={<div>404 - Page Not Found</div>} />
      </Routes>
    </Router>
  );
}

export default App;
